        1. &#1042;&#1099; &#1074;&#1099;&#1073;&#1080;&#1088;&#1072;&#1077;&#1090;&#1077; Asterisk, &#1077;&#1089;&#1083;&#1080; &#1093;&#1086;&#1090;&#1080;&#1090;&#1077; &#1079;&#1072;&#1087;&#1083;&#1072;&#1090;&#1080;&#1090;&#1100; &#1079;&#1072; &#1040;&#1058;&#1057;, &#1074; 5-10 &#1088;&#1072;&#1079; &#1084;&#1077;&#1085;&#1100;&#1096;&#1077;, &#1095;&#1077;&#1084; &#1087;&#1086;&#1083;&#1091;&#1095;&#1072;&#1077;&#1090;&#1089;&#1103; &#1087;&#1088;&#1080; &#1088;&#1072;&#1089;&#1095;&#1077;&#1090;&#1077; &#1086;&#1073;&#1099;&#1095;&#1085;&#1086;&#1081; &#1040;&#1058;&#1057;. &#1042;&#1099; &#1090;&#1072;&#1082; &#1078;&#1077; &#1085;&#1077; &#1093;&#1086;&#1090;&#1080;&#1090;&#1077; &#1087;&#1086;&#1082;&#1091;&#1087;&#1072;&#1090;&#1100; &#1074; &#1042;&#1072;&#1096; &#1086;&#1092;&#1080;&#1089; &#1092;&#1072;&#1082;&#1089; &#1080; &#1082;&#1072;&#1078;&#1076;&#1099;&#1077; 3 &#1076;&#1085;&#1103; &#1079;&#1072;&#1087;&#1088;&#1072;&#1074;&#1083;&#1103;&#1090;&#1100; &#1077;&#1075;&#1086; &#1073;&#1091;&#1084;&#1072;&#1075;&#1086;&#1081;.
