<node COLOR="#111111" CREATED="1266513037187" FOLDED="true" ID="ID_1013783416" MODIFIED="1273099308703" TEXT="TOP 100">
<edge COLOR="#111111" WIDTH="thin"/>
<node COLOR="#111111" CREATED="1266513019437" ID="ID_1339378202" MODIFIED="1266522016765">
<richcontent TYPE="NODE"><html>
  <head>
    
  </head>
  <body>
    <div style="padding-left: 8px; padding-bottom: 8px; padding-right: 8px; padding-top: 8px; height: 200px; white-space: pre-wrap">
      <p style="text-align: left">
        <strong>Popular IM Clients</strong>
      </p>
      <p>
        <a target="_blank" href="http://www.google.com/talk/">Google Talk</a> &#8211; use GTalk for your voice calls, voice messages, file transfer and <span class="searchterm3">Gmail</span> notifications
      </p>
      <p>
        <span class="searchterm4"><a target="_blank" href="http://www.skype.com/intl/en/">Skype</a></span> &#8211; high quality calls to anyone, anywhere in the world
      </p>
      <p>
        <span class="searchterm6"><a target="_blank" href="http://messenger.yahoo.com/">Yahoo</a></span><a target="_blank" href="http://messenger.yahoo.com/">! Messenger</a> &#8211; an official messenger for <span class="searchterm6">Yahoo</span>! users, free to use but advertising-supported
      </p>
      <p>
        <a target="_blank" href="http://www.aim.com/">AOL Instant Messenger </a>- communicate with AOL registered users via text, voice, and video
      </p>
      <p>
        <a target="_blank" href="http://get.live.com/messenger/overview">Windows Live Messenger</a> &#8211; connect and share instantly on the world&#8217;s most popular IM network
      </p>
      <p>
        <span class="searchterm2"><a target="_blank" href="http://www.icq.com/">ICQ</a></span> &#8211; the world&#8217;s first instant messaging program<a target="_blank" href="http://www.micq.org/"> </a>
      </p>
      <p>
        <a target="_blank" href="http://www.micq.org/">m<span class="searchterm2">ICQ</span></a> &#8211; a free text-based <span class="searchterm2">ICQ</span> client that runs on a wide variety of platforms
      </p>
      <p>
        <a target="_blank" href="http://licq.sourceforge.net/">L<span class="searchterm2">icq</span></a> &#8211; a free clone of the <span class="searchterm2">ICQ</span> client for Linux other Unix systems
      </p>
      <p>
        <a target="_blank" href="http://www.amsn-project.net/">aMSN</a> &#8211; a free and open source MSN Messenger clone for Linux users
      </p>
      <p>
        <a target="_blank" href="http://jmsn.sourceforge.net/">JMSN</a> &#8211; a pure Java MSN Messenger clone, with many interesting features that MSN doesn&#8217;t have
      </p>
      <p>
        <a target="_blank" href="http://www.cspace.in/">CSpace</a> &#8211; secure and peer-to-peer communication to chat or transfer files<a target="_blank" href="http://thecoccinella.org/"> </a>
      </p>
      <p>
        <a target="_blank" href="http://thecoccinella.org/">Coccinella</a> &#8211; a free <span class="searchterm5">Jabber</span>/XMPP client with a built-in white board for improved collaboration with other people
      </p>
      <p>
        <a target="_blank" href="http://www.emesene.org/trac/wiki/WikiStart">Emesene</a> &#8211; a MSN Messenger client with a simpler GUI and a nice look
      </p>
      <p>
        <a target="_blank" href="http://www.gajim.org/">Gajim</a> &#8211; a full-featured and easy to use XMPP client for gnome users
      </p>
      <p>
        <a target="_blank" href="http://goim.us/wiki/show/GOIM">GOIM</a> &#8211; allows users to chat within DirectX games
      </p>
      <p>
        <a target="_blank" href="http://www.lilotux.net/%7Emikael/mcabber/">mcabber</a> &#8211; a small <span class="searchterm1" id="high_1">console</span>-based <span class="searchterm5">Jabber</span> client that runs on Linux and Mac OS X
      </p>
      <p>
        <a target="_blank" href="http://www.gadu-gadu.pl/">Gadu-Gadu</a> &#8211; the most popular IM in Poland
      </p>
      <p>
        <a target="_blank" href="http://exodus.jabberstudio.org/">Exodus</a> &#8211; a <span class="searchterm5">Jabber</span> client which is small, fast, easy to use, and looks good
      </p>
      <p>
        <a target="_blank" href="http://retroshare.sourceforge.net/">Retroshare</a> &#8211; communicate and download files from friends of friends
      </p>
      <p>
        <a target="_blank" href="http://naim.n.ml.org/">naim</a> &#8211; a <span class="searchterm1">console</span> based multi-protocol client with features like peer to peer encryption and module support
      </p>
      <p>
        <a target="_blank" href="http://developer.imendio.com/projects/gossip/">Gossip</a> &#8211; an instant messaging client for <a target="_blank" href="http://www.gnome.org/">Gnome</a> users, with chat history search
      </p>
      <p>
        <a target="_blank" href="http://www.kranos.com/messagemate.php">MessageMate</a> &#8211; commercial IM platform that provides end-to-end security; interoperable with AIM, <span class="searchterm2">ICQ</span>, <span class="searchterm6">Yahoo</span> and MSN
      </p>
      <p>
        <a target="_blank" href="http://instant.papla.pl/text.asp?file=index.html">Papla Instant</a> &#8211; use it on your PC and mobile phone
      </p>
      <p>
        <a target="_blank" href="http://www.mercury.to/">Mercury Messenger </a>- a full featured Windows Live Messenger client, offers several extra features which are not implemented in MSN
      </p>
      <p>
        <a target="_blank" href="http://psi-im.org/">Psi</a> &#8211; small, fast <span class="searchterm5">Jabber</span> client
      </p>
      <p>
        <a target="_blank" href="http://www.igniterealtime.org/projects/spark/">Spark</a> &#8211; free and open source IM with built-in support for group chat, telephony integration and strong security
      </p>
      <p>
        <a target="_blank" href="http://www.jabbin.com/int/">Jabbin</a> &#8211; free <span class="searchterm5">Jabber</span> client that enables free calls using VoIP
      </p>
      <p>
        <a target="_blank" href="http://ysmv7.sourceforge.net/index.html">YSM</a> &#8211; full-featured <span class="searchterm1">console</span>-based <span class="searchterm2">ICQ</span> client
      </p>
      <p>
        <a target="_blank" href="http://myspace.com/myspaceim">MySpaceIM</a> &#8211; the official instant messaging client for MySpace
      </p>
      <p>
        <a target="_blank" href="http://www.process-one.net/en/oneteam/">OneTeam</a> &#8211; IM client is XUL based, so requires Firefox 2
      </p>
      <p>
        <a target="_blank" href="http://www.microsoft.com/mac/default.aspx?pid=msnmessenger">Microsoft Messenger for Mac</a> &#8211; the official Mac client for MSN Messenger, but the feature list is limited
      </p>
      <p>
        <a target="_blank" href="http://www.xfire.com/">Xfire</a> &#8211; chat with contacts inside the game, without the need to minimize the game windows
      </p>
      <p>
        <a target="_blank" href="http://www.pandion.be/">Pandion</a> &#8211; <span class="searchterm5">Jabber</span> client which supports plugins to extend its features
      </p>
      <p>
        <a target="_blank" href="http://www.bitwiseim.com/">BitWise IM</a> &#8211; a secure, cross-platform client that encrypts all data sent between users
      </p>
      <p style="text-align: left">
        <strong>Multi-network IM Clients</strong>
      </p>
      <p>
        <a target="_blank" href="http://pidgin.im/pidgin/home/">Pidgin</a> &#8211; most popular, free, multi-platform IM client that supports most of the IM protocols
      </p>
      <p>
        <a target="_blank" href="http://www.miranda-im.org/">Miranda IM</a> &#8211; lightweight, resource efficient and easy to use client with powerful plugin support
      </p>
      <p>
        <a target="_blank" href="http://ayttm.sourceforge.net/">Ayttm</a> &#8211; in case of a service failure, this will automatically fall back to other service protocols of the same person you are chatting to.
      </p>
      <p>
        <a target="_blank" href="http://www.ceruleanstudios.com/">Trillian</a> &#8211; a Windows application that can connect to multiple IM services, with nice features like Metacontact, Instant lookup, and Emotiblips
      </p>
      <p>
        <a target="_blank" href="http://www.meetro.com/">meetro</a> &#8211; find and chat with people nearby, i.e. location-aware client
      </p>
      <p>
        <a target="_blank" href="http://www.imvu.com/">IMVU</a> &#8211; 3D chat which enables you chat in 3D scenes with your own avatars
      </p>
      <p>
        <a target="_blank" href="http://kopete.kde.org/">Kopete</a> &#8211; KDE application, provides users with a single, easy-to-use way to access all of their instant messaging systems
      </p>
      <p>
        <a target="_blank" href="http://mecamessenger.com/">MECA</a> &#8211; connect to all of your friends on AIM, MSN, <span class="searchterm6">Yahoo</span>! and <span class="searchterm2">ICQ</span> from just one list
      </p>
      <p>
        <a target="_blank" href="http://thekonst.net/en/centericq">Center<span class="searchterm2">icq</span></a> &#8211; text based multi protocols IM client
      </p>
      <p>
        <a target="_blank" href="http://proteusx.org/">Proteus</a> &#8211; popular client for Mac OS X that supports multiple protocols
      </p>
      <p>
        <a target="_blank" href="http://www.interactiveni.com/imsite/imfreeware.htm">Instan-t</a> &#8211; Windows client that allows users to communicate with MSN, AIM, Y!Messenger, <span class="searchterm2">ICQ</span> and its IM networks
      </p>
      <p>
        <a target="_blank" href="http://www.apple.com/macosx/features/ichat/">iChat</a> &#8211; IM Client from Apple for Mac OSX
      </p>
      <p>
        <a target="_blank" href="http://www.universalmessengerplus.com/">Universal Messenger Plus</a> &#8211; a single convenient interface that allows you to easily communicate over different protocols.
      </p>
      <p>
        <a target="_blank" href="http://qnext.com/">Qnext</a> &#8211; share your music, photos, and files with anyone, instantly while talking via IM
      </p>
      <p>
        <a target="_blank" href="http://www.adiumx.com/">Aduim</a> &#8211; free client for Mac users that can connect to most of the popular messaging services
      </p>
      <p>
        <a target="_blank" href="http://bitlbee.org/main.php/news.r.html">BitlBee</a> &#8211; IRC clients with support of IM protocols
      </p>
      <p>
        <strong>Web based IM</strong>
      </p>
      <p>
        <a target="_blank" href="http://www.meebo.com/">meebo</a> &#8211; the most popular third party web based instant messaging service
      </p>
      <p>
        <a target="_blank" href="http://www.ebuddy.com/">eBuddy</a> &#8211; chat with your buddies using web and mobile versions
      </p>
      <p>
        <a target="_blank" href="http://www.koolim.com/">KoolIM</a> &#8211; web-based IM that allows you to connect to your email inbox as well as popular IM networks
      </p>
      <p>
        <a target="_blank" href="http://www.iloveim.com/">ILoveIM</a> &#8211; another web based IM service with advertisements
      </p>
      <p>
        <a target="_blank" href="http://www66.imhaha.com/webmsg/">IMhaha</a> &#8211; supports <span class="searchterm6">Yahoo</span>, MSN and AIM but not Google Talk
      </p>
      <p>
        <a target="_blank" href="http://www.goowy.com/">Goowy</a> &#8211; more than just an IM client; offers e-mail, calendar, news, RSS, file storage and more
      </p>
      <p>
        <a target="_blank" href="http://www.imunitive.com/index.html">IMunitive</a> &#8211; an alternative to meebo, but doesn&#8217;t support <span class="searchterm5">Jabber</span> i.e. Google Talk
      </p>
      <p>
        <a target="_blank" href="http://www.radiusim.com/">RadiusIM</a> &#8211; web-based IM service with Google Maps integration, which means you can see where your friends are
      </p>
      <p>
        <a target="_blank" href="http://www.messengerfx.com/">MessengerFX </a>- unofficial web based IM client for MSN Messenger
      </p>
      <p>
        <span class="searchterm2"><a target="_blank" href="http://download.icq.com/download/icq2go/">ICQ</a></span><a target="_blank" href="http://download.icq.com/download/icq2go/">2Go!</a> &#8211; web-based installation-free version of <span class="searchterm2">ICQ</span>
      </p>
      <p>
        <a target="_blank" href="http://www.snimmer.com/">SNIMMER</a> &#8211; chat on MSN, <span class="searchterm6">Yahoo</span>, AOL, <span class="searchterm2">ICQ</span> and GTalk and make new friends by creating a profile with pictures
      </p>
      <p>
        <a target="_blank" href="https://imo.im/">IMO</a> &#8211; allows you to log in to all chat networks at the same time
      </p>
      <p>
        <a target="_blank" href="http://www.communicationtube.com/">Communicationtube</a> &#8211; separate login for <span class="searchterm2">ICQ</span>, MSN Messenger, IRC and Google Talk contacts
      </p>
      <p>
        <a target="_blank" href="http://express.instan-t.com/MyIM/start.htm">Express Instan-t</a> &#8211; simple IM which works with <span class="searchterm2">ICQ</span>, MSN and <span class="searchterm6">Yahoo</span>
      </p>
      <p>
        <a target="_blank" href="http://www.easymessenger.net/">easymessenger</a> &#8211; free instant messenger service with built-in RSS support that works with MSN, <span class="searchterm2">ICQ</span>, AIM, <span class="searchterm6">Yahoo</span>! and <span class="searchterm5">Jabber</span>.
      </p>
      <p>
        <a target="_blank" href="http://www.mabber.com/home.php">mabber</a> &#8211; use it on your phone or put it on your website
      </p>
      <p>
        <a target="_blank" href="http://www.msn2go.com/">MSN2Go</a> &#8211; Java applet that enables you connect to MSN messenger service
      </p>
      <p>
        <a target="_blank" href="http://yafumato.sourceforge.net/">Yafumato Web Messenger</a> &#8211; free and open source web-based IM client that allows you to connect to AIM, GTalk, MSN, and <span class="searchterm6">Yahoo</span>
      </p>
      <p>
        <a target="_blank" href="http://webmessenger.msn.com/">MSN Web Messenger</a> &#8211; the web-based version of MSN Messenger, without file sharing or video calls
      </p>
      <p>
        <span class="searchterm6"><a target="_blank" href="http://webmessenger.yahoo.com/">Yahoo</a></span><a target="_blank" href="http://webmessenger.yahoo.com/">! Web Messenger</a> &#8211; access to your <span class="searchterm6">Yahoo</span>! messenger, chat with your friends and get notified when new email is received.
      </p>
      <p>
        <a target="_blank" href="http://aimexpress.aim.com/">AIM Express</a> &#8211; official web-based instant messenger for AIM
      </p>
      <p>
        <a target="_blank" href="http://www.gmail.com/">Google Talk via <span class="searchterm3">Gmail</span></a> &#8211; chat with your GTalk contacts from Google mail
      </p>
      <p>
        <strong>Mobile IM</strong>
      </p>
      <p>
        <a target="_blank" href="http://www.agilemobile.com/">Agile Messenger</a> &#8211; user friendly all-in-one application for your mobile phone
      </p>
      <p>
        <a target="_blank" href="http://www.eqo.com/">Eqo</a> &#8211; save up to 95% on calls, 70% on text messaging, integrates all of MSN, <span class="searchterm6">Yahoo</span>!, GTalk, AIM, <span class="searchterm2">ICQ</span>, and <span class="searchterm5">Jabber</span>.
      </p>
      <p>
        <a target="_blank" href="http://www.fring.com/">fring</a> &#8211; use it as an IM client, but also for free calls over Wi-Fi, GPRS or EDGE
      </p>
      <p>
        <a target="_blank" href="http://www.shapeservices.com/en/products/details.php?product=im&amp;platform=none">IM+</a> &#8211; All-in-One Mobile Messenger that works on any mobile device
      </p>
      <p>
        <a target="_blank" href="http://www.octro.com/">OctroTalk</a> &#8211; keeps you connected with your buddies, and works seamlessly over GPRS/EDGE/CDMA/Wifi/Bluetooth data connections
      </p>
      <p>
        <a target="_blank" href="http://www.quickim.com/index_en.html">QuickIM</a> &#8211; connect to public MSN networks using your cell phone with one time license fee
      </p>
      <p>
        <a target="_blank" href="http://www.beejive.com/index.php">JiveTalk</a> &#8211; connect simultaneously to AIM, MSN, <span class="searchterm6">Yahoo</span>!, Google Talk, <span class="searchterm2">ICQ</span>, and <span class="searchterm5">Jabber</span>
      </p>
      <p>
        <a target="_blank" href="http://causerie.mantragroup.com/products.php">Causerie</a> &#8211; an easily configurable chat tool with simple-to-use user interface that work on Palm, Blackberry, Pocket PC, Symbian and J2ME enabled phones.
      </p>
      <p>
        <a target="_blank" href="http://www.tipic.com/">TipicME</a> &#8211; J2ME-based <span class="searchterm5">Jabber</span> client that is really well done and absolutely free
      </p>
      <p>
        <a target="_blank" href="http://www.iskoot.com/">iSkoot</a> &#8211; mobile application that allows you to connect by GPRS, 3G or Wifi and to speak or chat with all your contacts on <span class="searchterm4">Skype</span>
      </p>
      <p>
        <a target="_blank" href="http://www.movamessenger.com/">MovaMessenger</a> &#8211; a free mobile IM client, works with MSN, <span class="searchterm6">Yahoo</span>, AIM, <span class="searchterm2">ICQ</span>, and GTalk
      </p>
      <p>
        <a target="_blank" href="http://www.mobileinttech.com/">Turbo MSN</a> &#8211; a mobile MSN client for Nokia and Panasonic
      </p>
      <p>
        <a target="_blank" href="http://www.nimbuzz.com/en/">Nimbuzz</a> &#8211; call your IM buddies on their mobile or on their PC, chat with your IM buddies for free and send text messages for free.
      </p>
      <p>
        <a target="_blank" href="http://www.heysan.com/">Heysan</a> &#8211; web based mobile messenger, compatible with most of the mobile phones including iPhone.
      </p>
      <p>
        <a target="_blank" href="http://www.yehba.com/home/index.php?option=com_content&amp;task=view&amp;id=27&amp;Itemid=82">YehBA Mobile IM</a> &#8211; allows you chat with your friends anywhere in the world, meet new friends across the globe through chat rooms, and have access to an unlimited number of fun services.
      </p>
      <p>
        <a target="_blank" href="http://www.palringo.com/">Palringo Vocal IM</a> &#8211; transforms your mobile device into a walkie-talkie: communicate with a contact or a group at the touch of a button
      </p>
      <p>
        <a target="_blank" href="http://www.souluna.com/2007/01/mt-messenger-v110.html">MT Messenger</a> &#8211; exchange messages using the most popular IM applications from MSN, <span class="searchterm6">Yahoo</span>! and AOL
      </p>
      <p>
        <a target="_blank" href="http://www.softpedia.com/get/Office-tools/Fax-Telephony/EpyxMobile.shtml">EpyxMobile</a> &#8211; call all over the world from your mobile phone for <span class="searchterm4">Skype</span>Out tariffs
      </p>
      <p>
        <a target="_blank" href="http://www.gotalkmobile.com/">GoTalkMobile</a> &#8211; Java application for J2ME enabled phones, allows you connect to Google Talk and <span class="searchterm5">Jabber</span>
      </p>
      <p>
        <a target="_blank" href="http://mobile.msn.com/pc/en-us/default.aspx">MSN Mobile</a> &#8211; take MSN with you
      </p>
      <p>
        <a target="_blank" href="http://messenger.mundu.com/">Mundu</a> &#8211; conference with your contacts across IM services in a single chat session
      </p>
    </div>
